const MovieList = () => {
    return (
        <div className="movie-section">
            <h2 style={{textAlign: left}}>Now Showing</h2>         
            <div className="movie-list">  
                {Array.from({ length: 5 }).map((_, i) => (
                    <MovieCard 
                        key={i} 
                        movie={{ 
                            name: "Movie " + i, 
                            description: "Description " + i, 
                            show_time: "12:00" 
                        }} 
                    />
                ))}
            </div>
        </div>
    );
};

export default MovieList;
